Jika limbah grease ini tidak ditangani secara tepat, akan menyebabkan :
1. Saluran pipa akan tersumbat oleh grease (Lemak) yang membeku serta mengeras.
2. Jika sampai keluar ke saluran kota akan menyebabkan bau tidak sedap dan menimbulkan penyakit.
3. Jika sampai masuk kedalam septic tank akan mengganggu proses septic tank

Grease Trap Portable ini dipasang dibawah Sink dapur.

Keunggulan produk grease Trap ini:
1. Harga murah
2. Ramah lingkungan
3. Design dan bentuk yang membuat bau Lemak tidak keluar karena menggunakan teknologi Vacumm seperti pintu kulkas.

TYPE IGT-30
Dimensi (mm):
(P) 42,8x (L) 34 x (T) 35
Material :
Poly Propylene (PP Plastic)
Pipa & Fittings :
PVC Diameter 1 1 /2"
Basket :
Poly Propylene (PP Plastic)

Cara Kerja:
sekat 1 : Semua air cucian dari cucian di Sink, akan mengalir masuk kedalam Grease Trap Portable. Sampah padat bekas akan tersaring pada Basket Strainer diameter 2mm.
Sekat 2 : Setelah melalui basket, air + grease masuk, Grease akan naik ke permukaan air secara gravitasi karena berat jenis grease lebih ringan dari pada air.
Sekat 3 : Kemudian air yang berada dibawah grease akan keluar melalui pipa ke saluran kota. Sampah-sampah pada basket dan grease yang ada dipermukaan air harus dibersihkan secara berkala.

Pemasangan mudah dilakukan dan Instruksi Petunjuk Penggunaan Portable Grease Trap akan diberikan salam setiap kemasan.

